import { Facebook, Instagram, Pinterest, Twitter } from '@mui/icons-material';
import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
    display:flex;
`;

const Left = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`;

const Logo = styled.h1``;

const Desc = styled.p``;

const SocialContainer = styled.div``;

const SocialIcon = styled.div``;



const Center = styled.div`
    flex: 1;
`;

const Right = styled.div`
    flex: 1;
`;


const Footer = () => {
    return (
        <Container>
            <Left>
                <Logo>Blanvic.</Logo>
                <Desc>
                    Lorem ipsum dolor sit amet consectetur adipisicing elit. Eaque quisquam rem impedit hic laborum eos repudiandae aliquam magnam facilis laudantium tenetur quos architecto aspernatur numquam, eius, velit illum cum omnis?
                </Desc>

                <SocialContainer>
                    <SocialIcon>
                        <Facebook />
                    </SocialIcon>
                    <SocialIcon>
                        <Instagram />
                    </SocialIcon>
                    <SocialIcon>
                        <Twitter />
                    </SocialIcon>
                    <SocialIcon>
                        <Pinterest />
                    </SocialIcon>
                </SocialContainer>
            </Left>

            <Center></Center>
            <Right></Right>
        </Container>

    )
}

export default Footer
